import React from 'react';
import { View, Text, TextInput, TouchableOpacity, StyleSheet, Image } from 'react-native';

function LoginForm() {
  return (
    <View style={styles.container}>
      <Text style={styles.title}>GHEU</Text>
      <View>
        <Text style={styles.label}>Usuario</Text>
        <View style={styles.inputIcon}>
          <Image source={{uri: 'https://cdn-icons-png.freepik.com/512/1077/1077063.png'}} style={styles.icon} />
          <View style={styles.line}></View>
          <TextInput style={styles.input} placeholder="Correo electr칩nico" />
        </View>
        <Text style={styles.label}>Contrase침a</Text>
        <View style={styles.inputIcon}>
          <Image source={{uri: 'https://cdn-icons-png.flaticon.com/512/747/747305.png'}} style={styles.icon} />
          <View style={styles.line}></View>
          <TextInput style={styles.input} secureTextEntry={true} placeholder="Contrase침a" />
        </View>
        <TouchableOpacity style={styles.button}>
          <Text style={styles.buttonText}>Iniciar Sesi칩n</Text>
        </TouchableOpacity>
      </View>
    </View>
  );
}

const styles = StyleSheet.create({
  container: {
    flex: 1,
    justifyContent: 'center',
    alignItems: 'center',
  },
  title: {
    fontSize: 40,
    fontWeight: 'bold',
