    padding: 0,
  },
  button: {
    backgroundColor: '#fff',
    borderWidth: 1,
    borderRadius: 20,
    padding: 10,
    alignItems: 'center',
  },
  buttonText: {
    fontWeight: 'bold',
  },
});

export default LoginForm;
